import React, {useEffect} from 'react';
import {Autocomplete, TextField} from "@mui/material";
import {useQuery} from "react-query";
import {getSalaryType} from "../../ApiService/salaryType.api";
import _ from "lodash";

const InputSalaryTypeFilter = (props: any) => {
    const [salaryType, setSalaryType] = React.useState([] as any)
    const [defaultValue, setDefaultValue] = React.useState(props.multiple ? [] : null as any)
    useEffect(() => {
        if (props.data && salaryType.length > 0) {
            let value = _.find(salaryType, (item) => {
                return item.id === props.data;
            })
            setDefaultValue(value);
        }
    }, [props.data, salaryType])
    // API get ALL Users
    useQuery({
        queryKey: ["getSalaryType"],
        queryFn: () => getSalaryType({params: {skip_page: 1}}),
        onSuccess: (data) => {
            setSalaryType(data.data);
        }
    })
    const handleOnChange = (event: any, values: any) => {
        setDefaultValue(values);
        props.onChange(values);
    }
    return (
        <Autocomplete
            multiple={props.multiple}
            id="combo-box-salary-type"
            options={salaryType}
            getOptionLabel={(option) => option.name}
            onChange={handleOnChange}
            value={defaultValue}
            size={props.size || "small"}
            renderInput={(params) => <TextField {...params} label={props.title}/>}
        />
    );
};

export default InputSalaryTypeFilter;
